// src/pages/Jobs/JobListingPage.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
// Import the searchJobs function and getEstimatedSalary for salary info
import { searchJobs, getEstimatedSalary } from '../../services/api';
import './JobListingPage.css';

// Inline SalaryDisplay component
// Inline SalaryDisplay component (updated)
const SalaryDisplay = ({ jobTitle, location }) => {
  const [salary, setSalary] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchSalary = async () => {
      try {
        const response = await getEstimatedSalary(jobTitle, location, 'ANY', 'ALL');
        // Assuming the API response has a "data" key that is an array:
        if (response && response.data && response.data.length > 0) {
          setSalary(response.data[0]);
        } else {
          setError("No salary data available");
        }
      } catch (err) {
        console.error("Error fetching salary:", err);
        setError("Salary info unavailable");
      } finally {
        setLoading(false);
      }
    };

    fetchSalary();
  }, [jobTitle, location]);

  if (loading) return <p>Loading salary...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div className="salary-display">
      <p>
        Salary Range: ${salary.min_salary.toFixed(2)} - ${salary.max_salary.toFixed(2)} {salary.salary_currency} per {salary.salary_period.toLowerCase()}
      </p>
      <p>Median Salary: ${salary.median_salary.toFixed(2)}</p>
      <p>Confidence: {salary.confidence}</p>
    </div>
  );
};


const JobListingPage = () => {
  const [jobs, setJobs] = useState([]);
  const [filter, setFilter] = useState('');

  // Fetch jobs using the searchJobs function.
  // This function calls the JSearch endpoint and returns a response whose
  // "data" key holds an array of job objects.
  const fetchJobs = async (query) => {
    try {
      const response = await searchJobs(query, 1, 1, 'us', 'all');
      // The API returns an object with a "data" key that contains the array of jobs.
      setJobs(response.data);
    } catch (error) {
      console.error('Error fetching jobs:', error);
    }
  };

  // On initial load, fetch default jobs.
  useEffect(() => {
    fetchJobs('developer jobs in chicago');
  }, []);

  // Filter the jobs based on job title or employer name.
  const filteredJobs = jobs.filter(
    (job) =>
      job.job_title?.toLowerCase().includes(filter.toLowerCase()) ||
      job.employer_name?.toLowerCase().includes(filter.toLowerCase())
  );

  // Handle search button click.
  const handleSearch = () => {
    fetchJobs(filter);
  };

  return (
    <div className="job-listing-container container">
      <aside className="filters">
        <h3>Filters</h3>
        <input
          type="text"
          placeholder="Search jobs..."
          value={filter}
          onChange={(e) => setFilter(e.target.value)}
        />
        <button onClick={handleSearch}>Search</button>
      </aside>
      <section className="jobs-section">
        <div className="jobs-header">
          <p>Showing {filteredJobs.length} results</p>
          <select>
            <option>Most Recent</option>
            <option>Highest Paying</option>
            <option>Location</option>
          </select>
        </div>
        <div className="jobs-grid">
          {filteredJobs.length > 0 ? (
            filteredJobs.map((job) => (
              <div key={job.job_id} className="job-card">
                <h3>{job.job_title}</h3>
                <p>
                  {job.employer_name} | {job.job_location}
                </p>
                {/* Display salary information inline */}
                <SalaryDisplay
                  jobTitle={job.job_title}
                  location={job.job_location}
                />
                <Link to={`/jobs/${job.job_id}`} className="btn btn-primary">
                  Apply Now
                </Link>
              </div>
            ))
          ) : (
            <p>No jobs found.</p>
          )}
        </div>
      </section>
    </div>
  );
};

export default JobListingPage;
